import React from 'react'
import { makeStyles } from '@material-ui/core/styles';
import Hidden from '@material-ui/core/Hidden';
import Shipping from './static/shipping.png';

const useStyles = makeStyles((theme) => ({
	 mainbox : {
	  margin : 'auto',
	  width : '100%',
	  height : '600px',
	},
	mobilebox : {
	  margin : 'auto',
	  width : '100%',
	  height : '560px',
	  padding : '250px 70px'

	},


})
);

function Checkout(){
	const classes = useStyles();
	document.body.style = 'background: #B0DFE5;';
	return(
		<>
		 <Hidden xsDown>
			<div className={classes.mainbox} >
		    	<img src={Shipping} alt='Shipped' style={{position : 'absolute', top : '40%', left : '40%', paddingLeft : '40px'}}/>
		        <br/>
		        <br/>

		    	<p style={{fontSize : '34px', color : 'white', position : 'absolute', top : '45%', left : '26%', paddingRight : '150px', lineHeight : '1.4'}}>Order #3321 has been shipped LaptopNg</p>
		    </div>
		  </Hidden>

		  <Hidden smUp>

		  	<div className={classes.mobilebox}>
		    	<img src={Shipping} alt='Shipped' style={{paddingLeft : '50px'}}/>
		    	<br/>
		    	<br/>
		        <br/>

		    	<p style={{fontSize : '25px', color : 'white', lineHeight : '0.3'}}>Order #3321 has been shipped LaptopNg</p>
		    </div>
		  </Hidden>
		 </>
		);
}

export default Checkout
